import React from 'react'
import './ratings.css'
import RatingsData from "./RatingsData";
function Ratings(){
    return(
        <div className="ratings">
            <div className="ratings-wrapper">
                    <img  className="ratings-image" src={RatingsData.id}/>
                    {/*<h4 className="ratings-info">{props?.professor?.name}</h4>*/}
            </div>
        </div>
    )
}
export default Ratings
